package main

import "fmt"

func step() bool {
	nrows := len(m)
	ncols := len(m[0])
	swaps := false

	nm := make([][]rune,nrows)
	for r, _ := range nm {
		nm[r] = make([]rune,ncols)
		copy(nm[r], m[r])
	}

	nextCol := func(c int) int {
		n := c+1
		if n >= ncols {
			n = 0
		}
		return n
	}
	
	swapCol := func(r1, c1, r2, c2 int) {
		nm[r1][c1], nm[r2][c2] = nm[r2][c2], nm[r1][c1]
		swaps = true
	}

	for r := 0; r < nrows; r++ {
		for c := ncols - 1; c >= 0; c-- {
			cell := m[r][c]
			switch cell {
			case '>':
				n := nextCol(c)
				if m[r][n] == '.' {
					swapCol(r,c,r,n)
				}
			}
		}
	}

	nnm := make([][]rune,nrows)
	for r, _ := range nnm {
		nnm[r] = make([]rune,ncols)
		copy(nnm[r], nm[r])
	}

	nextRow := func(r int) int {
		n := r+1
		if n >= nrows {
			n = 0
		}
		return n
	}

	swapRow := func(r1, c1, r2, c2 int) {
		nnm[r1][c1], nnm[r2][c2] = nnm[r2][c2], nnm[r1][c1]
		swaps = true
	}
	for c := 0; c < ncols; c++ {
		for r := nrows -1; r >= 0; r-- {
			cell := nm[r][c]
			switch cell {
			case 'v':
				n := nextRow(r)
				if nm[n][c] == '.' {
					swapRow(r,c,n,c)
				}
			}
		}
	}
	copy(m, nnm)
	return swaps
}

func main() {
	i := 0
	for step() {
		i++
		fmt.Println(i)
		print(m)
	}
	fmt.Println(i+1)
}

func print(s [][]rune) {
	for _, row := range s {
		var str []rune
		for _, v := range row {
			str = append(str, v)
		}
		fmt.Println(string(str))
	}
	fmt.Println("")
}

